import React from "react";

const About = () => {
  return (
  <div>
      <h2>모두를 위한 은퇴계산기 만든사람 소개</h2>
      <br />
      <h3>이름 : 정승진</h3>
      <h3>학교 및 전공 : 한국방송통신대학교(인천), 컴퓨터과학과</h3>
      <h3>학번 : 201734-243047</h3>
      <br />
      <h2>모두를 위한 은퇴계산기는 이런 마음으로 만들었습니다.</h2>
      <h3>코로나 19, 저금리, 저소득 등으로 많은 사람들이 힘들어 하는 중에</h3>
      <h3>주식, 부동산, 암호자산 등에 투자한 사람들은 큰 이익을 얻었습니다.</h3>
      <h3>이런 상황에서 아무것도 안한사람들은 무엇이라도 해야 하는 공포를 느꼈고, 서로의 수익을 비교하며 </h3>
    </div>
  )
};

export default About;
